 min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1481869","type":"CustomJS"},{"attributes":{"below":[{"id":"1481526"}],"center":[{"id":"1481529"},{"id":"1481533"},{"id":"1481844"}],"height":400,"left":[{"id":"1481530"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_border_top":3,"outline_line_color":"#666666","renderers":[{"id":"1481803"},{"id":"1481810"},{"id":"1481816"},{"id":"1481822"},{"id":"1481828"},{"id":"1481850"}],"sizing_mode":"stretch_width","title":{"id":"1481830"},"toolbar":{"id":"1481542"},"toolbar_location":null,"width":null,"x_range":{"id":"1481517"},"x_scale":{"id":"1481522"},"y_range":{"id":"1481520"},"y_scale":{"id":"1481524"}},"id":"1481518","subtype":"Figure","type":"Plot"},{"attributes":{"children":[{"id":"1481940"},{"id":"1481942"}],"sizing_mode":"stretch_width"},"id":"1481943","type":"Row"},{"attributes":{"fill_color":{"value":"cyan"},"hatch_color":{"value":"cyan"},"line_color":{"value":"cyan"},"size":{"value":8},"x":{"value":584},"y":{"value":2.026157031600001}},"id":"1481608","type":"
